    "contracts/ERC721Test0.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import 'erc721a-upgradeable/contracts/ERC721AUpgradeable.sol';
import "erc721a/contracts/ERC721A.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import '@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol';
import "@openzeppelin/contracts/proxy/Clones.sol";
import "hardhat/console.sol";

contract ERC721Test0 is ERC721AUpgradeable, OwnableUpgradeable {

    /// @dev This is the max mint batch size for the optimized ERC721A mint contract
    uint256 internal immutable MAX_MINT_BATCH_SIZE = 8;

    using Counters for Counters.Counter;
    Counters.Counter private _tokenIdCounter;

    bool private _initialized = false;

    // Metadata
    string public remixUri;
    address public creatorAddress;

    // Sales Configuration
    uint256 public price;
    uint256 public maxSupply;
    uint256 public mintLimitPerWallet;
    uint256 public saleEndTime;

    // Derivative Configuration
    uint256 public royaltyBps;
    uint256 public mintFee;
    address public creatorProceedRecipient;
    address public derivativeFeeRecipient;

    function initialize(address _creator,
        string memory _name, 
        string memory _symbol, 
        string memory _uri, 
        address _creatorProceedRecipient,
        address _derivativeFeeRecipient,
        uint256 _price,
        uint256 _maxSupply,
        uint256 _mintLimitPerWallet,
        uint256 _saleEndTime
    ) public initializerERC721A initializer {
        require(!_initialized, "Contract instance has already been initialized");

        __ERC721A_init(_name, _symbol);
        __Ownable_init();

        remixUri = _uri;
        creatorAddress = _creator;
        creatorProceedRecipient = _creatorProceedRecipient;
        derivativeFeeRecipient = _derivativeFeeRecipient;
        price = _price;
        maxSupply = _maxSupply;
        mintLimitPerWallet = _mintLimitPerWallet;
        saleEndTime = _saleEndTime;

        _initialized = true;
    }

    function _baseURI() internal view override returns (string memory) {
        return remixUri;
    }

    function purchase(uint256 quantity) public payable {

        // Check sale active
        require(_saleActive(), "Sale has ended");

        // Check supply
        if (quantity + _totalMinted() > maxSupply) {
            revert("This drop is sold out");
        }

        // Check price
        uint256 expectedPrice = (price + mintFee) * quantity;
        require(msg.value == expectedPrice, "Incorrect purchase price");

        // Check limit
        if (mintLimitPerWallet != 0 && 
            _numberMinted(_msgSender()) + quantity > mintLimitPerWallet) {
            revert("Cannot purchase that many");
        }

        // Mint!
        _mintNFTs(_msgSender(), quantity);
    }

    /// Batch in size of 8 for ERC721A
    function _mintNFTs(address to, uint256 quantity) internal {
        do {
            uint256 toMint = quantity > MAX_MINT_BATCH_SIZE
                ? MAX_MINT_BATCH_SIZE
                : quantity;
            _mint({to: to, quantity: toMint});
            quantity -= toMint;
        } while (quantity > 0);
    }

    function _saleActive() internal view returns (bool) {
        if (saleEndTime == 0) { return true; }
        return saleEndTime > block.timestamp;
    }

    function tokenURI(uint256 tokenId)
        public
        view
        override(ERC721AUpgradeable)
        returns (string memory)
    {
        require(_exists(tokenId), "invalid token ID");
        return _baseURI();
    }
}
"
    },
    "contracts/TestDeployer.sol": {
      "content": "//SPDX-License-Identifier: Unlicense
pragma solidity ^0.8.17;


import "./ERC721Test0.sol";

import {ISplitMain} from "splits-utils/src/interfaces/ISplitMain.sol";
import "@openzeppelin/contracts/proxy/Clones.sol";

import "hardhat/console.sol";

contract TestDeployer {
    address[] public remixContractArray;
    ISplitMain public immutable splitMain;
    address public controller;

    address immutable remixImplementation;

    event PublishedRemix(
        address indexed creator,
        address remixContractAddress,
        address creatorProceedRecipient,
        address derivativeFeeRecipient
    );

    constructor(address _splitMainAddress, address _controller, address _implementation) {
        splitMain = ISplitMain(_splitMainAddress);
        controller = _controller;
        remixImplementation = _implementation;
    }

    function publishRemix(
        address _creator,
        string memory _name,
        string memory _symbol, 
        string memory _uri, 
        address[] memory creatorProceedAccounts, 
        uint32[] memory creatorProceedAllocations,
        address[] memory derivativeFeeAccounts, 
        uint32[] memory derivativeFeeAllocations,
        uint256 _price,
        uint256 _maxSupply,
        uint256 _mintLimitPerWallet,
        uint256 _saleEndTime
    ) public {

        address creatorSplit = splitMain.createSplit({
            accounts: creatorProceedAccounts,
            percentAllocations: creatorProceedAllocations,
            distributorFee: 0,
            controller: controller
        });

        address derivativeFeeSplit = splitMain.createSplit({
            accounts: derivativeFeeAccounts,
            percentAllocations: derivativeFeeAllocations,
            distributorFee: 0,
            controller: controller
        });

        address remixClone = Clones.clone(remixImplementation);
        ERC721Test0(remixClone).initialize(_creator, _name, _symbol, _uri, creatorSplit, derivativeFeeSplit, _price, _maxSupply, _mintLimitPerWallet, _saleEndTime);
        remixContractArray.push(remixClone);

        emit PublishedRemix({
            creator: msg.sender,
            remixContractAddress: remixClone,
            creatorProceedRecipient: creatorSplit,
            derivativeFeeRecipient: derivativeFeeSplit
        });
    }
}"
